import React from "react";
import { Container, Row, Col, Form, Button } from "react-bootstrap";
const Contact = () => {
	return (
		<Container md>
			<Row className = "justify-content-center">
				<h1>Contact</h1>
			</Row>

			<Col>
				<Form>
					<Row></Row>
					<Col></Col>
				</Form>
			</Col>
		</Container>
	);
};

export default Contact;
